import React from "react";
import logo from "../assets/logo.png"; // Ensure this path is correct

const Header = () => {
  return (
    <header className="flex justify-between items-center p-4 bg-black bg-opacity-50 text-white fixed top-0 left-0 w-full z-10">
      {/* Logo and Title */}
      <div className="flex items-center">
        <img src={logo} alt="RC Studios Logo" className="h-12" />
        <h1 className="text-white text-2xl font-bold ml-2">RC Studios</h1>
      </div>

      {/* Book Consultation Button */}
      <div className="flex items-center">
        <a
          href="https://calendar.google.com/"
          target="_blank"
          rel="noopener noreferrer"
          className="text-white bg-blue-600 px-4 py-2 rounded-md hover:bg-blue-500 transition"
        >
          Book Consultation
        </a>
      </div>
    </header>
  );
};

export default Header;
